project:
I have an important message for you:

1 - This world is divided into 100 regions;
2 - Within each land, you can build foundations. Villages have no backup effect;
3 - The other foundations (temples, hideouts, watchtowers, and markets) offer backups to the surrounding region;
4 - That is, land with or nearby a temple, for example, is worth more than a region with just a village.
5 - Press <ENTER> to close this message and start to play.
